import React from 'react';

function ViewFertilizers() {
  return (
    <div>
      <h2>View Fertilizers</h2>
      <ul>
        <li>Search & Filter</li>
        <li>View Details</li>
      </ul>
    </div>
  );
}

export default ViewFertilizers;
